export default class GoalID extends Component {
  componentDidMount() {
    api.getGoals()
      .then(goalzz => {
        console.log(goalzz, 2452452345)
        this.setState({
          goals: goalzz
        })
      })
      .catch(err => console.log(err))
  }

  render() {
    return (
      <Fragment>
        Goal ID Test
      </Fragment>
    )
  }
}
